Like this post & we’ll donate.
@iammarleydias is our new inspiration. The author, student-activist and host of #BookmarksNetflix show now has a brightly lit desk space and reading/crochet corner. (Watch to see the room reveal.) 📚 In fifth grade, Marley was frustrated about the lack of diverse narratives offered to her at school and created the #1000BlackGirlBooks campaign with a goal to collect 1000 books where black girls are the main characters. Over the past 5 years, she’s collected 13,000 of these books. 👏🏿 For each like this post gets, we will donate $3 toward Marley’s causes (full donation amount up to $1500). Funding will go towards GrassROOTS Community Foundation, a public health & social action org that invests in their community members’ collective well-being by funding, supporting, developing and scaling community health and wellness programs for women and girls, particularly those who are impoverished, in addition to advocating for policies and practices that reduce disparities and foster equity. Charity contact information: grassrootscommunityfoundation.org/. Runs from 6/14 - 6/28.
